import './App.css';
import Nav from './components/navBar.js';
import Header from './components/Header.js';
import Body from './components/Body.js';
import Pages from './components/Pages.js';
import {BrowserRouter as Router} from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Router>
        <Nav/>
        <Header/>
        <Body/>
        <Pages/>
      </Router>
    </div>
  );
}

export default App;
